// Dependencies.
import React from 'react';

// Component 'DiveDeep'.
function DiveDeep() {
    return (
        // DiveDeep Container.
        <div className="container-fluid text-center">
            {/* My Profile Picture */}
            <img id="iamshawn-profile" className="img-thumbnail" alt="iamshawn.jpg" src="../../assets/misc/iamshawn.jpg" />
            <h1 className="display-4 text-white">Dive Deeper!</h1>
            <button className="btn btn-info hvr-icon-sink">
                About Me <i class="fas fa-angle-double-down hvr-icon-sink"></i>
            </button>
        </div>
    );
}

// Do export.
export default DiveDeep;
